// index.js是js入口文件
// 引入ReactDOM
import ReactDOM from 'react-dom/client'

// 创建一个JSX
const APP = (
  <div>
    <h1>这是一个React项目</h1>
    <p>我终于有了第一个React项目了！!</p>
  </div>
)

// 获取根容器
const root = ReactDOM.createRoot(document.getElementById('root'))

// 在跟容器渲染APP
root.render(APP)
